import Card from "./components/card";
import './App.css';
import cards from "./cards.json";

class App extends Component {

  state = {
    cards
  };

  render() {
    return (
      <div >
        <header className="App-header">
          <Card></Card>
        </header>
      </div>
    );
  }
}

export default App;
